  ngOnInit(): void {
    this.post.ViewContract().subscribe(data => {
      this.source = data.Data;
      this.oneContract = data;
    });


  }

  ViewUserDetails(event) {
    this.MainEvent = event.data;

    switch(event.action) {
      case 'Download':
        this.downloadAsPDF(event.data);
        break;
      case 'Testing':
          this.contractView(event);

        this.disabled1 = false;
        this.disabled2 = true;
        break;
    }
  }

  contractView(event) {
    // this.MainEvent = event;
    this.venderService.ViewVender().subscribe(data => {
      this.vender = data.Data;
    });

    this.itemService.ViewItem().subscribe(data => {
      this.item = data.Data;
    });
    this.SimplingForm = this.fb.group({
      trash: [null],
      fiberness: [null],
      mi: [null],
      uhml: [null],
      ui: [null],
      sfi: [null],
      fibrestrf: [null],
      rd: [null],
      bplus: [null],
      cg: [null],
    });
    this.ContractForm =  this.fb.group({
      vendorModel: this.fb.group({
        id: [event.data.vendorModel.id],
      }),
      itemdata: this.fb.group({
        id: [event.data.itemdata.id],
      }),
      quantity: [event.data.quantity,Validators.required],
      contractNo: [event.data.contractNo],
      invoiceno: [event.data.invoiceno],
      originname: [event.data.originname],
      portOfDischarged: [event.data.portOfDischarged],
      blNo: [event.data.blNo],
      containerNo: [event.data.contractNo],
      station: [event.data.station],
      vom: [event.data.vom],
      press_running_no: [event.data.press_running_no],
      gstno: [event.data.gstno],
      panno: [event.data.panno],
      trash: [event.data.trash],
      mic: [event.data.mic],
      broker: [event.data.broker],
      length: [event.data.length],
      moisture: [event.data.moisture],
      status: [false],
      partyLotModels: this.fb.array([this.AddpartyLot()]),
    });
    this.PoForm =  this.fb.group({
      poNumber: []
    });

  }

  onPOSubmit() {

  }
  quantity(event) {
    let partylotno =Math.ceil(event.target.value/100);
    this.partyLot.clear();
    for(let i = 0; i < partylotno; i++) {
      this.partyLot.push(this.AddpartyLot()); //pop
    }
  }

  AddpartyLot() {
    return this.fb.group({
      partyNumber: [null],
    });
  }
  get partyLot() {
    return this.ContractForm.get('partyLotModels') as FormArray;
  }
